import React, {  } from 'react';
import './assets/FormCrearEvento.css';
import { useNavigate } from 'react-router-dom';
const ModalSalir = ({ message, onClose }) => {
    const Navigate = useNavigate();
  const handleSiClick = () => {
    onClose();
    //window.location.href = '../pages/Home.jsx';
    Navigate("/ConfigurarEvento");
    
  };

  const handleNoClick = () => {
    // Cerrar solo el modal, no abandonar el registro
    onClose();
  };


  return (
    <div className='modal-container' >
      <div className='modalCrearEvento4'>
      <div className="FondoModal1">
            <h2 className="CrearEvento">{message}</h2>
          </div>
          <div className="FondoModal1">
        <div className='message'></div>
        <div className="FondoModal1">
            <h2 className="CrearEvento">¿Está seguro que desea Cancelar la creación del evento</h2>
        </div>
          <div className="ConfbuttonRequisitos">
              <button className="buttonRequisitos" type="button" onClick={handleNoClick}>
                No
              </button>
              <button className="buttonRequisitos" type="button" onClick={handleSiClick}>
                Sí
              </button>
            </div>
        </div>
      </div>
    </div>
  );
};

export default ModalSalir;
